import HomeNavbar from "../../../components/HomeNavbar/HomeNavbar";
import Profile from "../../../assets/icons/user.png";
const AcademicBlog = () => {
  return (
    <div className="academic-blog">
      <HomeNavbar />
      <p className="empty"></p>
      <p className="medium-header">Check Out Sample Assignments Below</p>
      <div className="card">
        <div className="col">
          <img
            src="https://plus.unsplash.com/premium_photo-1681755915233-9acafb348a7f?q=80&w=1470&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D"
            alt=""
          />
        </div>
        <div className="col">
          <img src={Profile} alt="" className="profile-image"/>
          <div className="profile-container"></div>
        </div>
      </div>
    </div>
  );
};

export default AcademicBlog;
